import React from 'react';
import "./style.css"
 
const Footer = () => {
    return (
        <div className='footer'>
            <div className="footer_left">left</div>
            <div className="footer_center">center</div>
            <div className="footer_right">right</div>
            
        </div>
    );
};

export default Footer;
